-- create the databases
CREATE DATABASE IF NOT EXISTS RAF;


CREATE TABLE employees (
  EMPLOYEE_ID INT PRIMARY KEY NOT NULL, # IDENTITY(1,1) 
  FIRST_NAME nvarchar(20) DEFAULT NULL,
  LAST_NAME nvarchar(25) NOT NULL,
  EMAIL nvarchar(25) NOT NULL,
  PHONE_NUMBER nvarchar(20) DEFAULT NULL,
  HIRE_DATE nvarchar(20) NOT NULL,
  JOB_ID nvarchar(10) NOT NULL,
  SALARY decimal(8,2) DEFAULT NULL,
  COMMISSION_PCT decimal(2,2) DEFAULT NULL,
  MANAGER_ID numeric(6) DEFAULT NULL,
  DEPARTMENT_ID numeric(4) DEFAULT NULL
);


